class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $k
     * @return Integer
     */
    function maximumBeauty($nums, $k) {
        sort($nums);
        $count = count($nums);
        $left = 0;
        $right = 0;
        $maxBeauty = 1;
        $currentSum = 0;

        while ($right < $count) {
            $currentSum += $nums[$right];

            while ($nums[$right] * ($right - $left + 1) - $currentSum > $k) {
                $currentSum -= $nums[$left];
                $left++;
            }

            $maxBeauty = max($maxBeauty, $right - $left + 1);
            $right++;
        }

        return $maxBeauty;
    }
}
